import styled from 'styled-components'

export const  Container=styled.div`
background: #1E252B;
*{
    padding: 0px;
    margin: 0px;
    background: #1E252B;
    box-sizing: border-box;
    font-family: 'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;
}
padding: 0px 38px;
flex: 1;
`
